import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

import SearchPage from './features/searchPage/searchPage';


export default function App() {
  return (
    <Router>
      <Route exact path={'/'}></Route>
      <SearchPage />
    </Router>
  )
};
